import TextField from "@mui/material/TextField";

function SMInput(props) {
  const { va,label, type, variant, onChange, required, disabled } = props;
  return (
    <>
      <TextField
        id="outlined-basic"
        type={type}
        fullWidth
        value={value}
        margin="normal"
        label={label}
        onChange={onChange}
        required={required}
        disabled={disabled}
        variant={variant ? variant : "outlined"}
      />
    </>
  );
}
export default SMInput;
